window.bookSummaryJSON = "<p>It's okay to have a few inner demons, right? </p> <p>Devon has a problem, and it's not just that her stealth skill is stuck at three. Though that<i> is</i> an issue when it comes to sneaking up on...well, anything. </p> <p>The real problem is that her former guildmate, Owen, is trapped in the demonic plane. Not just his in-game avatar. His mind is lost there too, leaving his real-life body in a coma. The only way to get him back, it seems, is to journey into the underworld and guide him back. </p> <p>Shouldn't be a big deal - as long as she doesn't mind transforming into a demon herself.</p> <p>Stonehaven League, Book 4 continues the saga! Are you ready for a new adventure? Jump in now!</p>"; 
